import React from 'react'
import infovideo from '../assets/infomercial.mp4'

const Infomercial = () => {
    return(
        <div>
            <div>Take a further look</div>
            <video className='infovideo' width="320" height="240" src={infovideo} type="video/mp4" controls>
                Your browser does not support the video tag.
            </video>
        </div>
    )
}

export default Infomercial
